import React from "react";

function Selector() {


    return (
        <>
            <p>Choose a Priority:</p>
            <select name="priority">
                <option value="High Priority">Volvo</option>
                <option value="Medium Priority">Saab</option>
                <option value="Low Priority">Opel</option>
            </select>
        </>
    );
}

export default Selector;
